import React from "react";
import "./App.css";
import useExchange from "./data/useExchange";
import { crypto, securitiesHiRisk } from "./data/data";

const App = () => {
  const rates = useExchange();
  const btcAmount = crypto.amount;
  return (
    <div className="App">{((1 / rates.BTC) * btcAmount).toFixed(2)} USD</div>
  );
};

export default React.memo(App);

